import React, {useState} from 'react';
import styles from "./SideBar.module.css"
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faCogs} from "@fortawesome/free-solid-svg-icons/faCogs";
import {faPlus} from "@fortawesome/free-solid-svg-icons";
import Modal from "./Modal";
import CreateNote from "./SideBarInstruments/CreateNote";


const SideBar = () => {
    const [showModal, setShowModal, children] = useState(false)
    return (
        <div className={styles.wrapper}>
            <ul>
                <li><FontAwesomeIcon icon={faPlus} onClick={() => setShowModal(true)} size="2x"/></li>
                <li><FontAwesomeIcon icon={faCogs} size="2x"/></li>
                <li><FontAwesomeIcon icon={faCogs} size="2x"/></li>
                <li><FontAwesomeIcon icon={faCogs} size="2x"/></li>
            </ul>
            <Modal active={showModal}  setActive = {setShowModal} clild = {children} >
                <CreateNote setActive = {setShowModal}/>
            </Modal>
        </div>

    );
};


export default SideBar;
